  const proyectos = [
    ["Proyectos"],[{id: 10, proyecto: "Pokedex Henry", descripcion: "Construir una App utilizando React, Redux, Node y Sequelize, crear filtros y ordenamientos para los elementos, crear nuevos", github: "", deploy: ""}, {id: 11, proyecto: "TICKETSHOP Henry", descripcion: "Construir una App con autenticación propia y de terceros, borrado lógico, notificiaciones e-mail, filtros combinados y más...", github: "", deploy: ""}, {id: 12, proyecto: "Responsive Design Product", descripcion: "Construir y maquetar una página estática de forma responsiva para entender el funcionamiento de los breakpoints", github: "", deploy: ""}, ]
  ]

