    ["Cursos y certificaciones"], [{id: 1, curso: "Curso Práctico de Maquetación en CSS", descripcion: "Crear un espacio personal para reforzar conocimientos en maquetación de HTML5 semántico, maquetando el header, el main y el footer, creando estilos para el proyecto de forma estética", link: "https://postimg.cc/dLXMTr4T" }, {id: 2, curso: "Responsive Design: Maquetación Mobile First", descripcion: "Aprender a crear prouectos que se adaptarán a las distintas vistas que utilicen los usuarios, se analizó la arquitectura de un proyecto partiendo de un wireframe, se auditó con Lighthouse", link: "https://postimg.cc/HcCTKKKm"}]
  ]



  return (
    <main className='blogs-main'>
        <SectionOne />
        <SectionTwo  data={proyectos}/>
        <SectionTwo data={cursos} />
    </main>
  )
}

export default HomeMain
